INSERT INTO `language_translations` VALUES (1,'teaser',1,'ua','technologies','Підготовка до вступу в спеціальність тестувальника за ISTQB',1),(2,'name',1,'ua','technologies','Практичне тестування по ISTQB',1),(3,'html',1,'ua','technologies','<p><a href=\"https://softserve.ua/press-center/news/more-service-from-softserve-it-academy/\">Детальніше&hellip;</a></p>\r\n<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Ви отримаєте теоретичні знання та практичні навики тестування програмного забезпечення за визнани',1),(4,'name',2,'ua','technologies','HTML5/ CSS3/ JavaScript Fundamentals',1),(5,'teaser',2,'ua','technologies','Web-розробка для початківців',1),(6,'html',2,'ua','technologies','<p><a href=\"https://softserve.ua/press-center/news/more-service-from-softserve-it-academy/\">Детальніше&hellip;</a></p>\r\n<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Разом з професіоналами своєї справи Ви отримаєте всі необхідні знання для того, щоб почати розроб',1),(7,'name',3,'ua','technologies','Java development',1),(8,'teaser',3,'ua','technologies','Розробка Web-аплікацій з використанням Java технологій',1),(9,'html',3,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Орієнтуючись на практичні знання, у Вас буде можливість в рамках платформи Java EE вивчити доступ до серверів реляційних баз даних засобами ORM Tools (Hibernate), JPA, JTA, JDBC.</li>\r\n<li>За смачною кавою, Ви будете ',1),(10,'name',4,'ua','technologies','.NET Development',1),(11,'teaser',4,'ua','technologies','Розробка Web-програм засобами С# .NET ',1),(12,'html',4,'ua','technologies','<h4>Що ми пропонуємо?</h4>\r\n<ul>\r\n<li>У серці найбільшої української IT-компанії у вас буде можливість вивчити технології та підходи до розробки Web-програм з багаторівневою архітектурою засобами мови C# і технології .NET Framework із застосуванням сучасн',1),(13,'name',5,'ua','technologies','IOS',1),(14,'teaser',5,'ua','technologies','Розробка додатків для iPhone/iPad',1),(15,'html',5,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Навчання з поглибленою практикою мови програмування Swift чи ObjectiveC на обладнанні Apple.</li>\r\n<li>Поряд зі справжніми IT-гуру Ви отримаєте можливість вивчити можливості IDE Xcode, ознайомитесь з концепцію MVC в i',1),(16,'name',6,'ua','technologies','Database',1),(17,'teaser',6,'ua','technologies','Розробка реляційних баз даних засобами Microsoft SQL Server',1),(18,'html',6,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви отримаєте практичний досвід роботи з Microsoft SQL Server 2012 для роботи з Data Mart, аналізу даних на основі OLAP кубів та прогнозування за допомогою Data Mining.</li>\n<li>Працюючи у команді, вивчите технології та ',1),(19,'name',7,'ua','technologies','Manual Quality Control',1),(20,'teaser',7,'ua','technologies','Ручне тестування програмного забезпечення',1),(21,'html',7,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>За сучасними методами підготовки, Ви отримаєте теоретичні та практичні навички ручного керування якістю програмних продуктів.</li>\n<li>На прикладах реальних проектів, Ви вивчите техніки та інструменти аналізу вимог до п',1),(22,'name',8,'ua','technologies','Automation Testing Quality Control',1),(23,'teaser',8,'ua','technologies','Розробка автоматизованих тестів перевірки якості ПЗ',1),(24,'html',8,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Працюючи в команді, Ви опануєте навички роботи з сучасними інструментами автоматизованого тестування програмного забезпечення.</li>\r\n<li>У межах актуальної спеціалізації ATQC, Ви познайомитесь з сучасними бібліотеками',1),(25,'name',9,'ua','technologies','DevOps',1),(26,'teaser',9,'ua','technologies','Гнучкі методології управління конфігураціями',1),(27,'html',9,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви ознайомитесь з основними процесами розробки програмного забезпечення</li>\n<li>Отримаєте змогу попрактикуватись в налогодженні інфраструктури забезпечення професійної розробки програмних продуктів</li>\n<li>Опануєте но',1),(28,'name',10,'ua','technologies','LAMP',1),(29,'teaser',10,'ua','technologies','Розробка Web-орієнтованого Програмного Забезпечення(ПЗ) для Linux з використанням Python/Django або Ruby-on-Rails',1),(30,'html',10,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви вивчите такі мови програмування як Python або Ruby.</li>\n<li>Отримаєте доступ до унікальних інформаційних ресурсів та зрозумієте тонкощі роботи з операційними системами Linux.</li>\n<li>LAMP-розробники з великим практ',1),(31,'name',11,'ua','technologies','Web UI',1),(32,'teaser',11,'ua','technologies','Створення кросбраузерних Web-сторінок з використанням мов HTML та CSS',1),(33,'html',11,'ua','technologies','<h3>Що ми пропонуємо?</h3>\r\n<ul>\r\n<li>Разом з справжніми професіоналами своєї справи Ви отримаєте актуальні знання зі створення HTML-розмітки і застосування CSS-стилів. Ви дізнаєтесь як зробити вашу верстку надійною, сучасною і кросбраузерною.</li>\r\n<li>К',1),(34,'name',12,'ua','technologies','Web UI (Full Stack)',1),(35,'teaser',12,'ua','technologies','Розробка Web-додатків з використанням JavaScript',1),(36,'html',12,'ua','technologies','<h3>Що ми пропонуємо?</h3>\n<ul>\n<li>Ви отримаєте практичний досвід у створенні багаторівневих, інтерактивних та складних web-додатків. Дізнайтесь тонкощі використання мови JavaScript і об’єктно-орієнтованих фреймворків на її основі (ExtJS або Backbone).</',1),(37,'name',13,'ua','technologies','UX',1),(38,'teaser',13,'ua','technologies','Вивчення фундаментальних принципів User Centered Design методології та проектування людино-машинної взаємодії (HCI)',1),(39,'html',13,'ua','technologies','<p><strong>Чого Ви навчитесь?</strong></p>\n<ul>\n<li>Отримаєте практичний досвід роботи з сучасними методами UX дизайну;</li>\n<li>Навчитесь об’єднувати в одне ціле форму та зміст проектного рішення;</li>\n<li>Дізнаєтеся як проектувати інтерфейси мобільних д',1),(40,'name',14,'ua','technologies','Quality Control for Cloud Computing',1),